import React from "react";
import { useRouter } from "next/router";
import Link from "next/link";

const NavLink = props => {
  const router = useRouter();
  return (
    <li>
      <Link href="/[id]" as={`/${router.query.id}`}>
        {props.children}
      </Link>
    </li>
  );
};

export default NavLink;
